class Solution:
    def maximumHappinessSum(self, happiness: List[int], k: int) -> int:
        happiness.sort(reverse=True)
        total = 0
        turns = 0
        
        for i in range(k):
            if happiness[i] - turns <= 0:
                return total

            total += happiness[i] - turns

            turns += 1

        return total

